webpackJsonp([65560048714138],{5863:function(e,t){e.exports={data:{post:{html:"<p>There's nothing like a 3-year-old with a birthday the same week as Christmas to keep things lively around the house between the holidays. And next year I'm sure that we will <em>not</em> invite the relatives to Christmas dinner and again two days later for birthday coffee and cake. It's like a bad case of d&eacute;j&agrave; vu.</p>\n<p>And on a completely unrelated note, I hate editing style sheets as well. After unsuccessfully trying to adapt the BlueRobot style from b2, I gave up and dug out my old MT style sheet from September.</p>",fields:{title:"All Wound Up",date:"29 Dec 2002",url:"https://papascott.de/2002-12-29-all-wound-up/"}}},pathContext:{slug:"/2002-12-29-all-wound-up/",prev:{fields:{title:"Oy Vey, All Ye Faithful",date:"26 Dec 2002",slug:"/2002-12-26-oy-vey-all-ye-faithful/"}},next:{fields:{title:"I'll kill that cat!",date:"31 Dec 2002",slug:"/2002-12-31-ill-kill-that-cat/"}}}}}});
